import User from "./components/User"
import Navbar from "./components/Navbar"
import React, { Component, useState } from 'react'
import './App.css';

export default class App extends Component{

  change = (cato) => {
    this.setState({ conTextt: cato.catogryNames });
  };

  render() {
let infoke = {title : "project"}
let infok = {title : "bar"}
    return (
      <div className="App">
      <h1>Logo</h1>
      <div className="container">

        <User title="project" />
        <Navbar info ={infok} /></div>
    </div>
    )}
}
